TX900001362=\"\uACB0\uC7AC\uB77C\uC778 \uC218\uC815 \uC635\uC158 \uC0AC\uC6A9 \uC2DC \uC218\uC815 \uAC00\uB2A5 \uC2DC\uC810\uC744 \uC124\uC815 \uD569\uB2C8\uB2E4.<br/> \uB2E4\uC74C \uACB0\uC7AC\uC790\uC758 \uACB0\uC7AC\uC804/ \uC5F4\uB78C\uC804 \uC124\uC815\uC5D0 \uB530\uB77C \uACB0\uC7AC\uB77C\uC778\uC744 \uC218\uC815 \uD560 \uC218 \uC788\uC2B5\uB2C8\uB2E4.<br/> \uC885\uACB0\uC804 \uC124\uC815 \uC2DC \uACB0\uC7AC\uBB38\uC11C \uC885\uACB0\uC804\uC5D0\uB294 \uAE30\uC548\uC790\uAC00 \uACB0\uC7AC\uB77C\uC778\uC744 \uC218\uC815 \uD560 \uC218 \uC788\uC2B5\uB2C8\uB2E4.\"
