TX900001370=\"\uACB0\uC7AC\uCDE8\uC18C \uAC00\uB2A5 \uC635\uC158 \uC0AC\uC6A9 \uC2DC \uCDE8\uC18C \uAC00\uB2A5 \uC2DC\uC810\uC744 \uC124\uC815 \uD569\uB2C8\uB2E4.<br/> \uB2E4\uC74C \uACB0\uC7AC\uC790\uC758 \uACB0\uC7AC\uC804/ \uC5F4\uB78C\uC804 \uC124\uC815\uC5D0 \uB530\uB77C \uACB0\uC7AC\uC2B9\uC778\uC5D0 \uB300\uD558\uC5EC \uCDE8\uC18C \uD560 \uC218 \uC788\uC2B5\uB2C8\uB2E4.\"
TX900001371=\"\uACB0\uC7AC\uB77C\uC778 \uC9C0\uC815 \uD31D\uC5C5 \uB0B4 \uC870\uC9C1\uB3C4 \uC870\uD68C \uBC94\uC704\uB97C \uC124\uC815 \uD560 \uC218 \uC788\uC2B5\uB2C8\uB2E4.<br/> - \uB0B4\uD68C\uC0AC : \uB85C\uADF8\uC778 \uAE30\uC900 \uD68C\uC0AC \uC870\uC9C1\uB3C4<br/> - \uADF8\uB8F9\uD551\uD68C\uC0AC : \uB85C\uADF8\uC778 \uAE30\uC900 \uD68C\uC0AC\uAC00 \uD3EC\uD568\uB41C \uADF8\uB8F9\uD551 \uB0B4 \uC804\uCCB4 \uD68C\uC0AC \"
TX900001372=\"\uACB0\uC7AC\uCC98\uB9AC \uD574\uC57C \uD558\uB294 \uBB38\uC11C\uC758 \uC870\uD68C \uBC0F \uACB0\uC7AC\uCC98\uB9AC \uBC94\uC704\uB97C \uC124\uC815 \uD560 \uC218 \uC788\uC2B5\uB2C8\uB2E4.<br/> \uACB0\uC7AC\uD568 \uBC94\uC704\uB9CC \uC81C\uACF5\uB418\uBA70, \uC774\uC804 \uBD80\uC11C\uC758 \uACB0\uC7AC\uCC98\uB9AC \uBB38\uC11C\uB294 \uC81C\uACF5\uB418\uC9C0 \uC54A\uC2B5\uB2C8\uB2E4. <br/> - \uBD80\uC11C : \uB85C\uADF8\uC778 \uBD80\uC11C \uAE30\uC900\uC73C\uB85C \uACB0\uC7AC\uBB38\uC11C \uC870\uD68C \uBC0F \uACB0\uC7AC\uCC98\uB9AC<br/>  - \uD68C\uC0AC : \uB85C\uADF8\uC778 \uD68C\uC0AC \uAE30\uC900\uC73C\uB85C \uACB0\uC7AC\uBB38\uC11C \uC870\uD68C \uBC0F \uACB0\uC7AC\uCC98\uB9AC\"
TX900001373=\"\uBE44\uC804\uC790 \uBB38\uC11C \uB4F1\uB85D \uC2DC \uBCF8\uBB38\uD30C\uC77C\uC774 PDF\uC778 \uACBD\uC6B0 \uC0AC\uC6A9 \uBDF0\uC5B4\uB97C \uC124\uC815\uD569\uB2C8\uB2E4.<br/> \uC774\uBBF8\uC9C0 \uBCC0\uD658 \uC120\uD0DD\uC2DC \uCCA8\uBD80\uB41C PDF\uD30C\uC77C\uC774 100%\uB85C \uBCC0\uD658\uB418\uC9C0 \uC54A\uC744 \uC218 \uC788\uC2B5\uB2C8\uB2E4.\"
