TX900001377=\"\uACB0\uC7AC\uBB38\uC11C \uC591\uC2DD \uB0B4 \uC8FC\uC18C \uD45C\uC2DC \uC601\uC5ED\uC5D0 \uBD80\uC11C(\uC870\uC9C1\uB3C4) \uB610\uB294 \uAC1C\uC778\uC758 \uC8FC\uC18C(\uD68C\uC0AC) \uD45C\uC2DC \uD560 \uC218 \uC788\uC2B5\uB2C8\uB2E4.<br/> \uC591\uC2DD \uB0B4 \uCF54\uB4DC\uAC00 \uC788\uB294 \uACBD\uC6B0 \uC120\uD0DD\uD55C \uC635\uC158 \uAC12\uC5D0 \uB530\uB77C \uBD80\uC11C \uB610\uB294 \uAC1C\uC778\uC758 \uC815\uBCF4\uAC00 \uD45C\uC2DC\uB429\uB2C8\uB2E4.<br/>  - \uBD80\uC11C : \uBD80\uC11C(\uC870\uC9C1\uB3C4\uC815\uBCF4\uAD00\uB9AC)\uC5D0 \uAE30\uC7AC\uB41C \uC8FC\uC18C \uD45C\uAE30 <br/> - \uAC1C\uC778 : \uB9C8\uC774\uD398\uC774\uC9C0 > \uAE30\uBCF8\uC815\uBCF4\uC218\uC815 \uB0B4 \uC8FC\uC18C(\uD68C\uC0AC) \uD45C\uAE30 \uAC1C\uC778\uC635\uC158 \uC0AC\uC6A9 \uC2DC \uC815\uBCF4\uAC00 \uBBF8 \uC785\uB825 \uB41C \uACBD\uC6B0 \uBD80\uC11C\uC5D0 \uAE30\uC7AC\uB41C \uC815\uBCF4\uB85C \uD45C\uAE30 \uB429\uB2C8\uB2E4.\"
TX900001378=\"\uACB0\uC7AC \uC591\uC2DD \uB0B4 \uCCA8\uBD80\uD30C\uC77C \uCF54\uB4DC\uAC00 \uC788\uB294\uACBD\uC6B0 \uCCA8\uBD80\uD30C\uC77C \uB9AC\uC2A4\uD2B8 \uD14D\uC2A4\uD2B8 \uD45C\uAE30 \uC2DC \uD655\uC7A5\uC790\uBA85 \uAE4C\uC9C0 \uD45C\uC2DC \uD560 \uAC83\uC778\uC9C0 \uC124\uC815 \uD560 \uC218 \uC788\uC2B5\uB2C8\uB2E4.<br/>  - \uC0AC\uC6A9 : \uCCA8\uBD80\uD30C\uC77C\uBA85.\uD655\uC7A5\uC790 (\uBB38\uC11C\uCCA8\uBD80.pdf)<br/>  - \uBBF8\uC0AC\uC6A9 : \uCCA8\uBD80\uD30C\uC77C\uBA85 (\uBB38\uC11C\uCCA8\uBD80)\"
TX900001379=\"\uACB0\uC7AC \uC9C4\uD589 \uC2DC \uD31D\uC5C5\uB0B4 \uACB0\uC7AC\uC758\uACAC \uC720/\uBB34 \uB97C \uC591\uC2DD\uC5D0 \uBC18\uC601\uB418\uB3C4\uB85D \uC120\uD0DD\uD558\uB294 \uAE30\uB2A5\uC744 \uC0AC\uC6A9\uD558\uB294 \uC635\uC158 \uC785\uB2C8\uB2E4.<br/> \uACB0\uC7AC \uC9C4\uD589 \uC2DC \uC120\uD0DD \uD560 \uC218 \uC788\uC2B5\uB2C8\uB2E4. \"
TX900001380=\"\uACB0\uC7AC\uBB38\uC11C\uC5D0 \uAC10\uC0AC\uB97C \uC801\uC6A9\uD574\uC57C \uD558\uB294 \uACBD\uC6B0 \uC0AC\uC6A9 \uD560 \uC218 \uC788\uC2B5\uB2C8\uB2E4.<br/> \uC124\uC815\uD55C \uAC10\uC0AC\uB97C \uC11C\uC2DD\uBCC4\uB85C \uC801\uC6A9\uD558\uC5EC \uACB0\uC7AC \uC9C4\uD589 \uD560 \uC218 \uC788\uC2B5\uB2C8\uB2E4.\"
TX900001381=\"\uACB0\uC7AC\uB77C\uC778\uC5D0 \uD3EC\uD568\uB418\uC9C0 \uC54A\uB294 \uBE44\uC0C1\uADFC \uAC10\uC0AC\uB85C \uC9C4\uD589/\uC885\uACB0\uB41C \uBB38\uC11C\uC5D0 \uAC10\uC0AC\uC758\uACAC\uC744 \uC785\uB825 \uD560 \uC218 \uC788\uC2B5\uB2C8\uB2E4.<br/> \uACB0\uC7AC\uB77C\uC778 \uC9C0\uC815 \uC2DC \uC120\uD0DD \uD560 \uC218 \uC788\uC2B5\uB2C8\uB2E4.\"
